import React from 'react'
import ProjectCard from '../Components/ProjectDetailsPage/ProjectCard'
import ForUpdate from '../Components/ProjectDetailsPage/ForUpdate';
import Bugs from "../Assests/images/Bugs.svg";
import ProjectDescription from '../Components/ProjectDetailsPage/ProjectDescription';
import ProjectName from '../Components/ProjectDetailsPage/ProjectName';


const ProjectDetails = () => {

  const projectname = [
    {
      projectName: "Trello",
      logoUrl: Bugs,
      status: "INPROGRESS",
      duration: "12 Aug - 13 Jun"
    }
  ]

  return (
    <div>
      <div className='ProjectDetails' >
        <div className='ProjectDetails-Head'>
          <p>Project Details</p>
        </div>

        <div>
          {projectname && projectname.map((namevalue) =>

        <ProjectName namevalue={namevalue} />)}
        </div>



        <div className='ProjectDetails_Card'>
          <ProjectCard />
        </div>

        <div>
          <ForUpdate />
        </div>
        <div>
          <ProjectDescription />
        </div>
      </div>

    </div>
  )
}

export default ProjectDetails;
